import React, { useState } from "react";
import { Modal } from "@mui/material";

const StateModal = ({ open, handelStateModalClose }) => {
  return (
    <Modal
      open={open} // Ensure 'open' is a boolean and is passed correctly
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      {/* Add your modal content here */}
      <div
        style={{ background: "white", padding: "20px", borderRadius: "5px" }}
      >
        <h2>Modal Content</h2>
        <p>This is an example modal.</p>
        <button
          style={{
            border: "none",
            background: "none",
            color: "red",
            marginTop: 10,
          }}
          onClick={handelStateModalClose()}
        >
          X
        </button>
      </div>
    </Modal>
  );
};
export default StateModal;
